const dataFabric = (function() {
    const { firstNamesFemale, firstNamesMale, lastNamesFemale, lastNamesMale } = namesData;

    const capitalizeFirstLetter = txt => txt[0].toUpperCase() + txt.slice(1).toLowerCase();
    const randomFromList = list => list[Math.floor(Math.random() * list.length)];
    const randomName = list => capitalizeFirstLetter(randomFromList(list));

    const randomFromScope = (min, max) => Math.round((Math.random() * (max - min)) + min);

    function* dataGenrator(n) {
        for (let i = 0; i < n; ++i) {
            const femaleOrMale = () => Math.round(Math.random());

            yield {
                firstName: femaleOrMale > .5 ? randomName(firstNamesFemale) : randomName(firstNamesMale),
                lastName: femaleOrMale > .5 ? randomName(lastNamesFemale) : randomName(lastNamesMale),
                weight: randomFromScope(40, 120),
                height: randomFromScope(150, 210),
            }
        }
    }

    const getAllTable = n => {
        let getData = dataGenrator(n)
        let res = [];

        for (;;) {
            let data = getData.next()
            if (data.done) break;
            res.push(data.value);
        }

        return res;
    }

    return {
        dataGenerator: dataGenrator,
        getAllTable,
    }
}());